.. ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ..... ......... ......... ......... ......... ......... ......... ......... ......... ......... ........ ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ......... ........ ......... ......... ......... TerminacionesTerminacionesTerminacionesTerminacionesTerminacionesTerminacionesTerminacionesTerminacionesTerminacionesTerminaciones335001057070049152174141432672173244835935315643692693607741891828159693.7001.2002.2001.2002001.0001.0001.4004001.0001.0001.0006002001.0001.0003.5001.0001.0001.0006002001.0001.0004001.000400........ ........ ........ ........ .................. ........ ........ .................. ........ ........ ............................ ........ ........ ........ ........ ........ ............................ ........ .................. ..........ESTE SORTEO PONE EN JUEGO 700.000.000 DE EUROS EN PREMIOS     1.ª   Compruebe si la fecha del sorteo y el dibujo que figuran en la parte superior de la lista\ncoinciden con los de su billete o décimo.\n    2.ª   En cada columna, y sólo en ella, están todos los premios y reintegros que han\ncorrespondido a todos los números que terminan con la cifra grande que la encabeza,\nclasificados en dos grupos: números completos y terminaciones.     Por  ejemplo, si su  número  termina  en 1,  ha de  fijar  su atención  únicamente  en  la columna\nencabezada con un uno. Los premios  indicados en  la  columna  «euros/billete»  son   los que\ncorresponden a un billete, o sea, a diez décimos.\n     3.ª    Vea si en la columna de números aparece el que Vd. juega y, si así fuera, a la derecha\nencontrará acumulado el importe total de los premios que han correspondido al billete.     4.ª    Si no está su número completo puede tener premio en el grupo de terminaciones. Si las hay\nde  cuatro cifras y su número  las tiene igualmente dispuestas,  a la derecha encontrará el total de\npremios  que han correspondido a todos  los números que terminan con  esas cuatro cifras.\n     Si no tiene premio por terminación de cuatro cifras, o no las hay, proceda en la misma forma con\nlas terminaciones de tres cifras, en su caso con las de dos y, finalmente, con las de una.I N S T R U C C I O N E S   P A R A   L A   C O N S U L T A   D E   E S T A   L I S T A\n\nEL PRESIDENTE,\n   La información sobre el pago de premios se encuentra\na disposición del público en cualquier punto de venta de\nLoterías y Apuestas del Estado, así como en la página\nweb de esta Sociedad.Madrid, 6 de enero de 2021\nSe celebrará el día 16 de enero, a las 13:00 horas, en Madrid Sede Central.\nConstará de diez series de 100.000 billetes cada una.\nPrecios..Premios..Por cada serie, 34.851\nPremio mayor, 1.300.000 euros\nUn premio especial de 14.870.000 euros para una fracción de uno\nde los billetes agraciados con el primer premio Por billete, 150 euros\nPor décimo, 15 eurosPRÓXIMO SORTEO: EXTRAORDINARIO DE INVIERNOPAGO DE PREMIOSLISTA OFICIAL de las extracciones realizadas y de los números que han resultado\npremiados en cada una de las cincuenta series  de 100.000  billetes de que consta\nel sorteo celebrado dicho día en Madrid Sede CentralESTOS PREMIOS CADUCAN A LOS TRES MESES, CONTADOS A PARTIR \nDEL DÍA SIGUIENTE AL DE LA CELEBRACIÓN DEL SORTEOSORTEO1.ºDE 2021 SORTEO EXTRAORDINARIO \nDE \"EL NIÑO\"\n6 DE ENERO DE 202110.000Reintegros de 200 euros cada uno, para los billetes cuya última cifra\nobtenida en la primera extracción especial sea....................................\n7\n10.000Reintegros de 200 euros cada uno, para los billetes cuya última cifra\nobtenida en la segunda extracción especial sea...................................4 20Premios de 3.500 euros cada uno, para todos los billetes terminados en:\n010159173418432\n491521672741835\n918926935936-   1.400Premios de 1.000 euros cada uno, para todos los billetes terminados en:\n0724284169 5.000Premios de 400 euros cada uno, para todos los billetes terminados en:\nEsta lista comprende los 37.920 premios adjudicados para cada serie. En el conjunto de las 50 series, resultan 1.896.000 premios, por un importe de 700.000.000 de euros19570\n03436\n055871  Premio de 2.000.000 de euros para el billete número....................................1  Premio de 750.000 euros para el billete número............................................1  Premio de 250.000 euros para el billete número............................................2\n2Aproximaciones de 12.000 euros cada una, para los billetes números.Aproximaciones de 6.100 euros cada una, para los billetes números...19569 y 19571\n03435 y 03437 99\n99\n99Centenas  de 1.000 euros cada una, para los billetes números 19500 \nal 19599, ambos inclusive (excepto el 19570).\nCentenas  de 1.000 euros cada una, para los billetes números 03400 \nal 03499, ambos inclusive (excepto el 03436).\nCentenas  de 1.000 euros cada una, para los billetes números 05500 \nal 05599, ambos inclusive (excepto el 05587). 99Premios  de 1.000 euros cada uno, para los billetes terminados como\nel primer premio en................................................................................\n570\n99Premios  de 1.000 euros cada uno, para los billetes terminados