n en la parte superior de la lista<br/>\n&#160; &#160; Por &#160;ejemplo, si su &#160;número &#160;termina &#160;en 1, &#160;ha de &#160;fijar &#160;su atención &#160;únicamente &#160;en &#160;la<br/>\n&#160; &#160; &#160;4.ª &#160; &#160;Si no está su número completo puede tener premio en el grupo de terminaciones. Si las hay<br/>\ncoinciden con los de su billete o décimo.<br/>\ncolumna encabezada con un uno.&#160;<b>Los &#160;premios &#160;indicados &#160;en &#160;la &#160;columna &#160;«euros/billete»</b><br/>\nde &#160;cuatro cifras y su número &#160;las tiene igualmente dispuestas, &#160;a la derecha encontrará el total de<br/>\n&#160; &#160; 2.ª &#160; En cada columna, y sólo en ella, están todos los premios y reintegros que han<br/>\n<b>son &#160; los que corresponden a un billete, o sea, a diez décimos.</b><br/>\npremios &#160;que han correspondido a todos &#160;los números que terminan con &#160;esas cuatro cifras.<br/>\ncorrespondido a todos los números que terminan con la cifra grande que la encabeza,<br/>\n&#160; &#160; &#160;3.ª &#160; &#160;Vea si en la columna de números aparece el que Vd. juega y, si así fuera, a la derecha<br/>\n&#160; &#160; &#160;Si no tiene premio por terminación de cuatro cifras, o no las hay, proceda en la misma forma con<br/>\nclasificados en dos grupos: números completos y terminaciones.<br/>\nencontrará acumulado el importe total de los premios que han correspondido al billete.<br/>\nlas terminaciones de tres cifras, en su caso con las de dos y, finalmente, con las de una.<br/>\n<hr/>\n<a name=2></a><img src=\"SM_LISTAOFICIAL.A2021.S085-2_1.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S085-2_2.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S085-2_3.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S085-2_4.jpg\"/><br/>\n<b>SORTEO</b><br/>\n<b>LISTA OFICIAL de las extracciones realizadas y de los números que han&#160;</b><br/>\nSORTEO DEL DÍA<br/>\n<b>resultado &#160;premiados en &#160;cada una de las seis series &#160;de 100.000 &#160;billetes&#160;</b><br/>\n<b>de que consta el sorteo celebrado dicho día en Madrid Sede Central</b><br/>\n28 DE OCTUBRE DE 2021<br/>\n<b>85.º</b><br/>\nESTOS PREMIOS CADUCAN A LOS TRES MESES, CONTADOS A PARTIR&#160;<br/>\n<b>Seis series de 100.000 billetes cada una</b><br/>\n<b>DE 2021</b><br/>\n<b>J U E V E S</b><br/>\nDEL DÍA SIGUIENTE AL DE LA CELEBRACIÓN DEL SORTEO<br/>\n40<br/>\nPremios de&#160;750&#160;euros cada uno, para todos los billetes terminados en:&#160;<br/>\n1&#160; Premio de&#160;<b>300.000</b>&#160;euros&#160;para el billete número.............................................<br/>\n<b>66289</b><br/>\n2&#160;Aproximaciones de&#160;12.000&#160;euros cada una, para los billetes números.<br/>\n<b>66288&#160;y&#160;66290</b><br/>\n<b>1710</b><br/>\n<b>3024</b><br/>\n<b>3651</b><br/>\n<b>7234</b><br/>\n99&#160;Centenas de&#160;300&#160;euros cada una, para los billetes números&#160;66200&#160;al<br/>\n66299, ambos inclusive (excepto el&#160;66289).<br/>\n9&#160;Premios &#160;de&#160;750&#160;euros &#160;cada uno, &#160;para los &#160;billetes terminados como<br/>\nel primer premio en................................................................................<br/>\n<b>6289</b><br/>\n700<br/>\nPremios de&#160;150&#160;euros cada uno, para todos los billetes terminados en:<br/>\n99&#160;Premios &#160;de&#160;150&#160;euros &#160;cada uno, &#160;para los &#160;billetes terminados como<br/>\nel primer premio en................................................................................<br/>\n<b>289</b><br/>\n<b>034</b><br/>\n<b>236</b><br/>\n<b>285</b><br/>\n<b>463</b><br/>\n999&#160;Premios &#160;de&#160;60&#160;euros &#160;cada uno, &#160;para los &#160;billetes terminados como<br/>\nel primer premio en................................................................................<br/>\n<b>89</b><br/>\n<b>614</b><br/>\n<b>653</b><br/>\n<b>728</b><br/>\n<b>- &#160;</b><br/>\n9.999&#160;Reintegros &#160;de&#160;30&#160;euros cada uno, para los billetes terminados como<br/>\nel primer premio en................................................................................<br/>\n<b>9</b><br/>\n9.000<br/>\nPremios de&#160;60&#160;euros cada uno, para todos los billetes terminados en:<br/>\n<b>04</b><br/>\n<b>29</b><br/>\n<b>31</b><br/>\n<b>41</b><br/>\n<b>55</b><br/>\n<b>65</b><br/>\n<b>81</b><br/>\n<b>90</b><br/>\n<b>93</b><br/>\n<b>-&#160;</b><br/>\n1&#160; Premio de&#160;<b>60.000</b>&#160;euros&#160;para el billete número...............................................<br/>\n<b>59576</b><br/>\n10.000<br/>\nReintegros de&#160;30&#160;euros cada uno, para los billetes cuya última cifra<br/>obtenida en la primera extracción especial sea....................................<br/>\n<b>8</b><br/>\n2&#160;Aproximaciones de&#160;7.470&#160;euros cada una, para los billetes números...<br/>\n<b>59575&#160;y&#160;59577</b><br/>\n99&#160;Centenas de&#160;150&#160;euros cada una, para los billetes números&#160;59500&#160;al<br/>\n59599, ambos inclusive (excepto el&#160;59576).<br/>\n10.000<br/>\nReintegros de&#160;30&#160;euros cada uno, para los billetes cuya última cifra<br/>obtenida en la segunda extracción especial sea...................................<br/>\n<b>7</b><br/>\n<b>Esta lista comprende los 41.050 premios adjudicados para cada serie. En el conjunto de las 6 series, resultan 246.300 premios, por un importe de 12.600.000 euros</b><br/>\n<b>PRÓXIMO SORTEO DEL JUEVES</b><br/>\nMadrid, 28 de octubre de 2021<br/>\n<b>PAGO DE PREMIOS</b><br/>\nSe celebrará el día 4 de noviembre, a las 21:00 horas, en Madrid Sede Central.<br/>\nEL PRESIDENTE,<br/>\n&#160; &#160;La información sobre el pago de premios se encuentra<br/>\nConstará de seis series de 100.000 billetes cada una.<br/>\na disposición del público en cualquier punto de venta de<br/>Loterías y Apuestas del Estado, así como en la página<br/>\n&#160; &#160; &#160;&#160;<br/>\nweb de esta Sociedad.<br/>\nPrecios..<br/>\nPor billete, 30 euros<br/>\nPremios..<br/>\nPor cada serie, 41.050<br/>\nPor décimo, 3 euros<br/>\nPremio mayor, 300.000 euros<br/>\n<hr/>\n</body>\n</html>\n', null);
