#160; E S T A &#160; L I S T A<br/>\n&#160; &#160; 1.ª &#160; Compruebe si la fecha del sorteo y el dibujo que figuran en la parte superior de la lista<br/>\n&#160; &#160; Por &#160;ejemplo, si su &#160;número &#160;termina &#160;en 1, &#160;ha de &#160;fijar &#160;su atención &#160;únicamente &#160;en &#160;la columna<br/>\n&#160; &#160; &#160; 4.ª &#160; &#160;Si no está su número completo puede tener premio en el grupo de terminaciones. Si las hay de<br/>\ncoinciden con los de su billete o décimo.<br/>\nencabezada con un uno.&#160;<b>Los premios &#160;indicados en &#160;la &#160;columna &#160;«euros/billete» &#160;son &#160; los que</b><br/>\ncuatro cifras y su número &#160;las tiene igualmente dispuestas, &#160;a la derecha encontrará el total de premios<br/>\n&#160; &#160; 2.ª &#160; En cada columna, y sólo en ella, están todos los premios y reintegros que han<br/>\n<b>corresponden a un billete, o sea, a diez décimos.</b><br/>\nque han correspondido a todos &#160;los números que terminan con &#160;esas cuatro cifras.<br/>\ncorrespondido a todos los números que terminan con la cifra grande que la encabeza,<br/>\n&#160; &#160; &#160;3.ª &#160; &#160;Vea si en la columna de números aparece el que Vd. juega y, si así fuera, a la derecha<br/>\n&#160; &#160; &#160;Si no tiene premio por terminación de cuatro cifras, o no las hay, proceda en la misma forma con las<br/>\nclasificados en dos grupos: números completos y terminaciones.<br/>\nencontrará acumulado el importe total de los premios que han correspondido al billete.<br/>\nterminaciones de tres cifras, en su caso con las de dos y, finalmente, con las de una.<br/>\n<hr/>\n<a name=2></a><img src=\"SM_LISTAOFICIAL.A2021.S088-2_1.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S088-2_2.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S088-2_3.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S088-2_4.jpg\"/><br/>\n<b>SORTEO</b><br/>\n<b>LISTA OFICIAL de las extracciones realizadas y de los números que han&#160;</b><br/>\n