cada uno, para todos los billetes terminados en:<br/>\ncomo el primer premio en......................................................................<br/>\n<b>4</b><br/>\n<b>034</b><br/>\n<b>035</b><br/>\n<b>184</b><br/>\n<b>411</b><br/>\n<b>531</b><br/>\n<b>550</b><br/>\n<b>688</b><br/>\n<b>777</b><br/>\n1&#160; Premio de&#160;<b>300.000</b>&#160;euros&#160;para el billete número............................................<br/>\n<b>11185</b><br/>\n<b>832</b><br/>\n<b>843</b><br/>\n<b>875</b><br/>\n<b>- &#160;</b><br/>\n2&#160;Aproximaciones de&#160;12.000&#160;euros cada una, para los billetes números.<br/>\n<b>11184&#160;y&#160;11186</b><br/>\n5.000&#160;Premios de&#160;300&#160;euros cada uno, para todos los billetes terminados en:<br/>\n99&#160;Centenas de&#160;750&#160;euros cada una, para los billetes números&#160;11100&#160;al<br/>\n11199, ambos inclusive (excepto el&#160;11185).<br/>\n<b>11</b><br/>\n<b>17</b><br/>\n<b>26</b><br/>\n<b>34</b><br/>\n<b>39</b><br/>\n1&#160; Premio de&#160;<b>150.000</b>&#160;euros&#160;para el billete número............................................<br/>\n<b>76602</b><br/>\n10.000&#160;Reintegros de&#160;150&#160;euros cada uno, para los billetes cuya última cifra<br/>\nobtenida en la primera extracción especial sea....................................<br/>\n<b>2</b><br/>\n2&#160;Aproximaciones de&#160;6.225&#160;euros cada una, para los billetes números...<br/>\n<b>76601&#160;y&#160;76603</b><br/>\n10.000&#160;Reintegros de&#160;150&#160;euros cada uno, para los billetes cuya última cifra<br/>\n99&#160;Centenas de&#160;750&#160;euros cada una, para los billetes números&#160;76600&#160;al<br/>\nobtenida en la segunda extracción especial sea...................................<br/>\n<b>6</b><br/>\n76699, ambos inclusive (excepto el&#160;76602).<br/>\n<b>Esta lista comprende los 37.555 premios adjudicados para cada serie. En el conjunto de las 10 series, resultan 375.550 premios, por un importe de 105.000.000 de euros</b><br/>\n<b>PRÓXIMO SORTEO DE LOTERÍA NACIONAL</b><br/>\nMadrid, 6 de noviembre de 2021<br/>\n<b>PAGO DE PREMIOS</b><br/>\nSe celebrará el día 13 de noviembre, a las 13:00 horas, en Madrid Sede Central.<br/>\nEL PRESIDENTE,<br/>\n&#160; &#160;La información sobre el pago de premios se encuentra<br/>\nConstará de diez series de 100.000 billetes cada una.<br/>\na disposición del público en cualquier punto de venta de<br/>Loterías y Apuestas del Estado, así como en la página<br/>\n&#160; &#160; &#160;&#160;<br/>\nweb de esta Sociedad.<br/>\nPrecios..<br/>\nPor billete, 60 euros<br/>\nPremios..<br/>\nPor cada serie, 41.341<br/>\nPor décimo, 6 euros<br/>\nPremio mayor, 600.000 euros<br/>\n<hr/>\n</body>\n</html>\n', null);
