que terminan con &#160;esas cuatro cifras.<br/>\ncorrespondido a todos los números que terminan con la cifra grande que la encabeza,<br/>\n&#160; &#160; &#160;3.ª &#160; &#160;Vea si en la columna de números aparece el que Vd. juega y, si así fuera, a la derecha<br/>\n&#160; &#160; &#160;Si no tiene premio por terminación de cuatro cifras, o no las hay, proceda en la misma forma con las<br/>\nclasificados en dos grupos: números completos y terminaciones.<br/>\nencontrará acumulado el importe total de los premios que han correspondido al billete.<br/>\nterminaciones de tres cifras, en su caso con las de dos y, finalmente, con las de una.<br/>\n<hr/>\n<a name=2></a><img src=\"SM_LISTAOFICIAL.A2021.S092-2_1.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S092-2_2.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S092-2_3.jpg\"/><br/>\n<img src=\"SM_LISTAOFICIAL.A2021.S092-2_4.jpg\"/><br/>\n<b>SORTEO</b><br/>\n<b>LISTA OFICIAL de las extracciones realizadas y de los números que han&#160;</b><br/>\nSORTEO DE LOTERÍA NACIONAL<br/>\n<b>resultado &#160;premiados en &#160;cada una de las diez series &#160;de 100.000 &#160;billetes&#160;</b><br/>\n<b>de que consta el sorteo celebrado dicho día en Madrid Sede Central</b><br/>\n<b>92.º</b><br/>\nESTOS PREMIOS CADUCAN A LOS TRES MESES, CONTADOS A PARTIR&#160;<br/>\n<b>DE 2021</b><br/>\n<b>S Á B A D O</b><br/>\n20 DE NOVIEMBRE DE 2021<br/>\nDEL DÍA SIGUIENTE AL DE LA CELEBRACIÓN DEL SORTEO<br/>\n1&#160; Premio de&#160;<b>600.000</b>&#160;euros&#160;para el billete número............................................<br/>\n<b>40892</b><br/>\n40&#160;Premios de&#160;1.500&#160;euros cada uno, para todos los billetes terminados en:<br/>\n2&#160;Aproximaciones de&#160;10.000&#160;euros cada una, para los billetes números.<br/>\n<b>40891&#160;y&#160;40893</b><br/>\n<b>4043</b><br/>\n<b>4751</b><br/>\n<b>6596</b><br/>\n<b>8667</b><br/>\n99&#160;Centenas de&#160;300&#160;euros cada una, para los billetes números&#160;40800&#160;al<br/>\n40899, ambos inclusive (excepto el&#160;40892).<br/>\n99&#160;Premios &#160;de&#160;300&#160;euros &#160;cada uno, &#160;para los &#160;billetes terminados como<br/>\nel primer premio en................................................................................<br/>\n<b>892</b><br/>\n1.000&#160;Premios de&#160;300&#160;euros cada uno, para todos los billetes terminados en:<br/>\n999&#160;Premios &#160;de&#160;120&#160;euros &#160;cada uno, &#160;para los &#160;billetes terminados como<br/>\nel primer premio en................................................................................<br/>\n<b>92</b><br/>\n<b>165</b><br/>\n<b>274</b><br/>\n<b>353</b><br/>\n<b>386</b><br/>\n<b>392</b><br/>\n<b>463</b><br/>\n<b>584</b><br/>\n<b>746</b><br/>\n<b>936</b><br/>\n<b>959</b><br/>\n9.999&#160;Reintegros de&#160;60&#160;euros cada uno, para los billetes terminados como<br/>\nel primer premio en................................................................................<br/>\n<b>2</b><br/>\n9.000&#160;Premios de&#160;120&#160;euros cada uno, para todos los billetes terminados en:<br/>\n<b>00</b><br/>\n<b>12</b><br/>\n<b>14</b><br/>\n<b>28</b><br/>\n<b>40</b><br/>\n<b>40</b><br/>\n<b>68</b><br/>\n<b>72</b><br/>\n<b>77</b><br/>\n<b>-&#160;</b><br/>\n1&#160; Premio de&#160;<b>120.000</b>&#160;euros&#160;para el billete número............................................<br/>\n<b>37405</b><br/>\n2&#160;Aproximaciones de&#160;5.540&#160;euros cada una, para los billetes números...<br/>\n<b>37404&#160;y&#160;37406</b><br/>\n10.000&#160;Reintegros de&#160;60&#160;euros cada uno, para los billetes cuya última cifra<br/>\n99&#160;Centenas de&#160;300&#160;euros cada una, para los billetes números&#160;37400&#160;al<br/>\nobtenida en la primera extracción especial sea....................................<br/>\n<b>9</b><br/>\n37499, ambos inclusive (excepto el&#160;37405).<br/>\n10.000&#160;Reintegros de&#160;60&#160;euros cada uno, para los billetes cuya última cifra<br/>\nobtenida en la segunda extracción especial sea...................................<br/>\n<b>7</b><br/>\n<b>Esta lista comprende los 41.341 premios adjudicados para cada serie. En el conjunto de las 10 series, resultan 413.410 premios, por un importe de 42.000.000 de euros</b><br/>\n<b>PRÓXIMO SORTEO DE LOTERÍA NACIONAL</b><br/>\nMadrid, 20 de noviembre de 2021<br/>\n<b>PAGO DE PREMIOS</b><br/>\nSe celebrará el día 27 de noviembre, a las 13:00 horas, en Madrid Sede Central.<br/>\nEL PRESIDENTE,<br/>\n&#160; &#160;La información sobre el pago de premios se encuentra<br/>\nConstará de diez series de 100.000 billetes cada una.<br/>\na disposición del público en cualquier punto de venta de<br/>Loterías y Apuestas del Estado, así como en la página<br/>\n&#160; &#160; &#160;&#160;<br/>\nweb de esta Sociedad.<br/>\nPrecios..<br/>\nPor billete, 60 euros<br/>\nPremios..<br/>\nPor cada serie, 41.341<br/>\nPor décimo, 6 euros<br/>\nPremio mayor, 600.000 euros<br/>\n<hr/>\n</body>\n</html>\n', null);
