1.ª</b><br/>\n<b>5.ª</b><br/>\n<b>15.000.000€</b><br/>\nPRIMER PREMIO<br/>\nI N S T R U C C I O N E S &#160; P A R A &#160; L A &#160; C O N S U L T A &#160; D E &#160; E S T A &#160; L I S T A<br/>\n&#160; &#160; 1.ª &#160; Compruebe si la fecha del sorteo y el dibujo que figuran en la parte superior de la lista<br/>\nencabezada con un uno.&#160;<b>Los &#160;premios &#160;indicados &#160;en &#160;la &#160;columna &#160;«euros/billete» &#160;son &#160; los</b><br/>\n&#160; &#160; &#160;4.ª &#160; &#160;Si no está su número completo puede tener premio en el grupo de terminaciones. Si las<br/>\ncoinciden con los de su billete o décimo.<br/>\n<b>que corresponden a un billete, o sea, a diez décimos.</b><br/>\nhay de &#160;cuatro cifras y su número &#160;las tiene igualmente dispuestas, &#160;a la derecha encontrará el<br/>\n&#160; &#160; 2.ª &#160; En cada columna, y sólo en ella, están todos los premios y reintegros que han corres-<br/>\n&#160; &#160; &#160;3.ª &#160; &#160;Vea si en la columna de números aparece el que Vd. juega y, si así fuera, a la derecha<br/>\ntotal de premios &#160;que han correspondido a todos &#160;los números que terminan con &#160;esas cuatro<br/>\npondido a todos los números que terminan con la cifra grande que la encabeza, clasificados en<br/>\nencontrará acumulado el importe total de los premios que han correspondido al billete, con<br/>\ncifras.<br/>\ndos grupos: números completos y terminaciones.<br/>\nexcepción de los especiales que figuran ya &#160;acumulados en el recuadro inmediatamente anterior<br/>\n&#160; &#160; &#160;Si no tiene premio por terminación de cuatro cifras, o no las hay, proceda en la misma forma<br/>\n&#160; &#160; Por &#160;ejemplo, si su &#160;número &#160;termina &#160;en 1, &#160;ha de &#160;fijar &#160;su atención &#160;únicamente &#160;en &#160;la columna<br/>\na estas instrucciones.<br/>\ncon las terminaciones de tres cifras, en su caso con las de dos y, finalmente, con las de una.<br/>\n<hr/>\n<a name=2></a><